The shortest #math paper published has only 2 words. The late John H. Conway and Alexander Soifer published it in the 
@maanow Monthly in 2004.

After submission, there was pushback from the editor. The authors responded: "What else is there to explain?" https://t.co/1JaTuDPdCV

